select 
o.id as "Rio Order Id",
p.id as "Rio Product Id",
o.order_date as "Order Placement Time" ,
--p.name,
--b.id,
--p.id as product_id,
--rp.scheme,
--oi.ordered_quantity,
--oi.rejected_quantity,
--oi.accepted_quantity,
--oi.undelivered_quantity,
--oi.final_quantity,
--case
--o.order_status when 1 then 'Pending'
--when 2 then 'Placed'
--when 3 then 'Processed'
--when 4 then 'Invoiced'
--when 5 then 'Failed'
--when 6 then 'Dispatched'
--when 7 then 'Delivered'
--END "Order Status" ,
--rp.stock as current_stock,

(select free_quantity from rio_oms_omstransactional.scheme_journal sj where fk_id_batch = b.id and last_modified_date <= o.order_date order by last_modified_date desc limit 1)
as scheme_in_quanity
,
(select discount_percentage from rio_oms_omstransactional.scheme_journal sj where fk_id_batch = b.id and last_modified_date <= o.order_date order by last_modified_date desc limit 1)
as scheme_in_perc
--,
--(select stock from rio_oms_omstransactional.inventory_journal ij  where fk_id_batch = b.id and last_modified_date <= o.order_date order by last_modified_date desc limit 1) as stock_at_the_timeoforder,

--ra.pincode,
--oi.total as Sale
--avg(oi.mrp) as mrp
from rio_oms_omstransactional.order_item oi 
join rio_oms_omstransactional."order" o  on oi.fk_id_order = o.id and o.is_active =1 and o.is_deleted =0
JOIN rio_oms_omstransactional.order_group og ON og.id  = o.fk_id_order_group 
JOIN rio_oms_omstransactional.retailer r ON r.id  = og.fk_id_retailer AND r.is_active = 1
LEFT JOIN rio_oms_omstransactional.address ra ON ra.id = r.fk_id_address
join rio_oms_omstransactional.distributor d on d.id = o.fk_id_distributor and d.is_active =1 and d.is_blocked =0 and d.is_test =0 and d.id <> 1900
join rio_oms_omstransactional.batch b on b.id = oi.fk_id_batch and b.is_active =1
join rio_oms_omstransactional.product p on p.id = b.fk_id_product and p.is_active =1
JOIN rio_analytics.distributor_list dl ON dl.dist_id  = d.id 
JOIN rio_oms_omstransactional.raw_product rp ON rp.distributor_item_code  = b.distributor_item_code 
AND b.fk_id_distributor  = rp.id_distributor  AND rp.is_active  = b.is_active 
left join rio_oms_omstransactional.manufacturer m2 
on p.fk_id_manufacturer =m2.id
where r.id
NOT IN (33443,9593,275489,128569) 
and DATE(convert_timezone('UTC','UTC-5:30',o.order_date)) =  date('2021-10-01') --and rp.scheme is not null




select * from rio_oms_omstransactional.scheme_journal sj where fk_id_batch = 3594604  order by last_modified_date DESC 
select * from rio_oms_omstransactional.inventory_journal ij where fk_id_batch = 2364538 order by last_modified_date DESC limit 10;



