with scheme as (select "Rio order Id",Ucode,batch_id,"Order Placement Time",listagg(scheme,',') as scheme
FROM 

(SELECT distinct "Rio order Id",Ucode,batch_id,"Order Placement Time",concat(concat(order_quantity,'+'),case when free_quantity=0 then discount_percentage else free_quantity end) as scheme FROM
(
select 
o.id as "Rio Order Id",
oi.ordered_quantity, 
rp.distributor_item_code as "Ucode",
o.order_date as "Order Placement Time" ,
b.id as batch_id,
oi.fk_id_scheme as order_scheme_id,
sj.id as scheme_id,
rp.scheme,
sj.order_quantity::text,
sj.free_quantity::text,
concat(sj.discount_percentage::text,'%') as discount_percentage,
ROW_NUMBER()over(partition by b.id,sj.id order by sj.last_modified_date desc) as date_rnk

from rio_oms_omstransactional.order_item oi 
join rio_oms_omstransactional."order" o  on oi.fk_id_order = o.id and o.is_active =1 and o.is_deleted =0
JOIN rio_oms_omstransactional.order_group og ON og.id  = o.fk_id_order_group 
--JOIN rio_oms_omstransactional.retailer r ON r.id  = og.fk_id_retailer AND r.is_active = 1
--LEFT JOIN rio_oms_omstransactional.address ra ON ra.id = r.fk_id_address
--join rio_oms_omstransactional.distributor d on d.id = o.fk_id_distributor and d.is_active =1 and d.is_blocked =0 and d.is_test =0 and d.id <> 1900
join rio_oms_omstransactional.batch b on b.id = oi.fk_id_batch and b.is_active =1
join rio_oms_omstransactional.scheme_journal sj on sj.fk_id_batch =b.id and sj.last_modified_date <= o.order_date and  sj.order_quantity <= oi.ordered_quantity and sj.is_active =1
join rio_oms_omstransactional.product p on p.id = b.fk_id_product and p.is_active =1
--JOIN rio_analytics.distributor_list dl ON dl.dist_id  = d.id 
JOIN rio_oms_omstransactional.raw_product rp ON rp.distributor_item_code  = b.distributor_item_code 
AND b.fk_id_distributor  = rp.id_distributor  AND rp.is_active  = b.is_active 
left join rio_oms_omstransactional.manufacturer m2 
on p.fk_id_manufacturer =m2.id
where  
 DATE(convert_timezone('UTC','UTC-5:30',o.order_date)) =  date(dateadd('day',-1,CURRENT_DATE)) --and rp.scheme is not null

)aa
where date_rnk =1
order by 1
)
group by 1,2,3,4
order by 1
)

select * from (
select sd.*,
ij.stock as "Available Quantity",
ROW_NUMBER()over(PARTITION by ij.fk_id_batch ORDER BY ij.last_modified_date ) as stock_rnk
FROM 
scheme sd 
join rio_oms_omstransactional.inventory_journal ij on ij.fk_id_batch = sd.batch_id and ij.last_modified_date >= sd."Order Placement Time" and  ij.is_active =1
)aa
where stock_rnk=1


